import React from 'react';
import { CartListProduct } from "./CartListProduct"

export const CartGrid = props => {
    // cart.map((ite, ind) => {
    //     if(![...items][ind].image.split("/")[2].split(".")[0] === ite.id) {
    //       console.log("yse")
    //     }
    //     return "no"
    //   })
    const list = props.newBoxs.slice(0, props.limit);
    const showCart = list.map((newBoxBaby) => { 
        const filterLink = newBoxBaby.image.split("/")[2].split(".")[0];
        return filterLink === newBoxBaby.id ? <CartListProduct
            key={newBoxBaby.id}
            newBoxBaby={newBoxBaby}
        /> : "no"
    });

    return (
        <div className='light-cart-list'>
            {showCart}
        </div>
    );
}
